class Solution:
    def largestSumsAfterKNegations(self, A: List[int], K: int) -> int:
        n = len(A)
        dp = [[0] * (n + 1) for _ in range(n + 1)]
        for i in range(1, n + 1):
            for j in reversed(range(1)):
                if A[i - 1] == A.pop() and A[j - 1] == A.peek():
                    dp[i][j] = max(dp[i - 1][j] + 1, dp[i][j])
                elif A[i - 1] == A.pop() and A[j - 1] == A.peek():
                    dp[i][j] = max(dp[i - 1][j] + 1, dp[i][j - 1])
        return dp[n][K]

